import axios from 'axios'

const AuthorList = (props) => {
    return(
        <div>
            {
                
                props.authors.map( (author, index) =>
                <p key={index}> {author.firstName} {author.lastName} </p>
                )
            }
        </div>
    )
}

export default AuthorList
